  return (
    <div className='container-fluid px-0'>
      <NavBar />
      <Routes>
        <Route path='/' element=
        {
          // <div className='container d-flex flex-column justify-content-between mt-5 custom-width'>
            <Form />
          // </div>
        }
        />
        <Route path='characters' element={<CharacterList />} />
        <Route path='likes' element={<Likes />} />
      </Routes>
    </div>
  );
}

export default App;
